
<!DOCTYPE html>
<html>
   <head>
      <title>The Cook Company</title>
      <style type="text/css">
         body{
            background: grey;
         }
         #container{
            background: black;
            overflow: hidden;
            top:0;
         }
         #container, #container > div, img{
            display:block;
            position: absolute;
            left:0;
            width: 1920px;
            height:1080px;
            transform: translateZ(0);
         }
         #container > div > img{
            top: 0;
         }
         .inactive{
            top: 1080px;
            opacity: 0;
            transition-property: opacity top;
            transition-duration: 0.5s;
            transition-timing-function: ease;
         }
         .active{
            top: 0;
            opacity: 1;
            transition-property: top;
            transition-duration: 0.5s;
            transition-timing-function: ease;
         }
         #free{
            background: rgba(255,255,0, 1);
         }
         #pro{
            background:rgb(0,220,0);
         }
         #enterprise{
            background: rgba(255,100,0);
         }
      </style>
      <script type="text/javascript">
         var START_DELAY = 500;
         var ANIM_DUR = 500;
         var HIDE_DELAY = 1000 * 60 * 0.25;
         var active = false;

         function activate(activeVersion){
            active = true;
            Array.prototype.forEach.call(document.getElementsByClassName('version'), function(el){
               if(el.id === activeVersion){
                  setTimeout(function(){ 
                     el.className = 'version active';
                     setTimeout(function(){
                        active = false;
                     }, ANIM_DUR);
                     setTimeout(function(){
                        el.className = 'version inactive';
                     }, ANIM_DUR + HIDE_DELAY);
                  }, START_DELAY);
               }else{
                  el.className = 'version inactive';
               }
            });
         }

         document.addEventListener('keydown',function(e){
            console.log(e.key, active);
            if(active){
               return;
            }
            if(e.key === 'a'){
               activate('free');
            }else if(e.key === 'b'){
               activate('pro');
            }else if(e.key === 'c'){
               activate('enterprise');
            }
         });
      </script>
   </head>
